// SPDX-Licence-Identifier: GPL-3.0;

pragma solidity ^0.8;

contract viewAndPureFunction {
    uint256 public age = 20;

    // 2Ô∏è‚É£ View Function
    // ‚úÖ Can read state
    // ‚ùå Cannot write state
    // ‚úÖ Must return something

    function View1() public view returns (uint256) {
        return age;
    }

    function View2() public view returns (uint256) {
        return age + 20;
    }


    // 3Ô∏è‚É£ Pure Function
    // ‚ùå Cannot read or write state
    // ‚úÖ Must return something
    // üß† Only uses inputs or local variables

    function Pure1() public pure returns (uint256) {
        return 10;
    }

    function Pure2(uint256 _x) public pure returns (uint256) {
        return _x;
    }


    // 1Ô∏è‚É£ Simple Function (no modifier)
    // ‚úÖ Can read & write state variables
    // ‚ùå Return is optional
    // ‚öôÔ∏è Used when you change state

    function Simple() public {
        age += 1;
    }
}

